'use strict';

import React from 'react';
import Button from 'react-bootstrap/Button';

const Login = () => {

  return (
    <div>
      <Button variant="outline-primary">Log in</Button>
      <Button variant="outline-info">Sign in</Button>
    </div>
  );
};

export default Login;
